import React from "react-router-dom";
import Products from "./Product"

 const ProductDetail = () => {

    return (
        <>
        <h1>Ini Halaman Product Detail</h1>
        {Products.map((Product) => (
         <img src = {Product.image}   />
        ))}
        </>


    )

}

export default ProductDetail
